import turtle
import base64
import json
import time

#Decode polygon data
encoded = ""
json_str = base64.b64decode(encoded.encode()).decode()
data = json.loads(json_str)

#Setup screen
screen = turtle.Screen()
screen.setup(1296, 800)
screen.bgcolor("white")
t = turtle.Turtle()
t.speed(0)
t.penup()
t.shape("turtle")
t.shapesize(2, 2, 2)

#turtle.tracer(0, 0) #You can comment this out if you want to see the drawing process

#Coordinate transform
def to_turtle_coords(x, y):
    return x - 1000 / 2, 562 / 2 - y

#Draw each polygon


for item in data:
    points = item["points"]
    color = item["color"]
    hex_color = "#%02x%02x%02x" % (color[2], color[1], color[0])
    t.fillcolor(hex_color)
    t.pencolor(hex_color)
    t.goto(to_turtle_coords(*points[0]))
    t.begin_fill()
    for x, y in points[1:]:
        t.goto(to_turtle_coords(x, y))
    t.goto(to_turtle_coords(*points[0]))
    t.end_fill()
    t.penup()

#Hide the turtle and finish
t.hideturtle()
turtle.update()
turtle.done()